import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

const pokemons = [];

fetch("https://pokeapi.co/api/v2/pokedex/kanto/")
    .then(result => result.json())
    .then(pokedex => {
        let pokemons = pokedex.pokemon_entries;
        pokemons.forEach(pokemon => {
            //console.log(pokemon);
            x.innerHTML = pokemon.pokemon_species.name;
            fetch("https://pokeapi.co/api/v2/pokemon/" + pokemon.pokemon_species.name +"/")
                .then(result => result.json())
                .then(pokemon => {
                    console.log(pokemon);
                    pokemons.push(pokemon);
                });
        });
    });

ReactDOM.render(<App pokemons={pokemons}/>, document.getElementById('root'));
